import React from 'react';
import TableWidget from '../widgets/TableWidget'
import {userColumns} from '../data/Userdata'

function Usertable(){
    const tableTitle="User List";
    return (
        <React.Fragment>            
            <TableWidget 
              rows={rows} 
              defaultSort='name'
              columns={userColumns}
              tableTitle={tableTitle}
            
            />
        </React.Fragment>
    );
}

export default Usertable;
